Основные психологические качества женщины-Афины
- высокая организованность; 
- мудрость; 
- самостоятельность; 
- отстраненность; 
- способность увидеть результат в целом; 
- неподвластность эмоциям; 
- эрудиция, интеллект; 
- мстительность; 
- безжалостность; 
- большая сила воли; 
- способность к дипломатии; 
- способность холодно оценивать ситуацию; 
- способность дружить с мужчинами-героями.  
Женщины-Афины сами находят своих мужчин, причем, сам мужчина никогда об этом не догадается. 
Она просчитывает потенциального победителя и прогнозирует его успешность. 
Ее никогда не интересуют мечтательные романтики. 
Если сотрудничает с успешным, деловым, логически думающим мужчиной, то в результате она становиться незаменимой для него. Но создает она такую атмосферу не для него, а для себя, готовя фундамент для своего дальнейшего развития. 
Власть – самое ценное, что привлекает Афину в этих отношениях.В замужестве ее брак напоминает союз партнеров.Афина всегда немного холодна и держится на расстоянии. Она не эмоциональна, но не прощает оскорблений и мстит так тонко, что со стороны может казаться, что все происходит само собой.Она любит, когда все четко и понятно, поэтому часто анализирует события, которые происходят, и текущие дела, активно использует эти привычки для управления своей жизнью. Однако, в силу постоянного утаивания своих эмоций, создается впечатление, что она как бы наблюдает за ситуацией со стороны, оставаясь равнодушной.
Афина — это сильная женщина, которая ценит такую же силу в мужчинах, которые идут к своей цели не смотря ни на какие препятствия, — сильных, находчивых и счастливых победителей в современной борьбе за власть. 
Эта женщина имеет тонкую интуицию и чувствует силу победителя.Она требовательна к себе и к окружающим. Афина сразу схватывает, что следует сделать, и рассчитывает пути достижения желаемого результата. Для нее важен только результат.
Геста (Гестия, Веста) — в этом архетипе целостность представлена максимально. Эта женщина имеет настолько развитый внутренний мир, что ей даже не нужно его выражать в достижении цели или карьере, он есть и ей этого довольно.Женщина-геста — это «вещь в себе», символ интровертированной самодостаточности, она эмоционально закрыта от повседневного мира. Владеет эмпатией и может ощущать людей,  понимать их мотивы, осознавать ситуацию, которая происходит,  но она не ощущает в этом нужды, ей комфортно в полном одиночестве или в узком кругу знакомых, где она создает вокруг себя ореол покоя.
Геста может иметь несколько подруг, которые так же не имеют потребности в частом общении.Для Гесты важен дом и уют.Ее устраивают отношения, в которых четко распределены обязанности.
Такая женщина может еще в раннем возрасте посвятить себя какой-нибудь религии и оставаться ей верной на протяжении всей жизни.
